import React, { useState, useEffect } from "react";
import ReactMapGl, { Marker, Popup } from "react-map-gl";
const access_token =
  "pk.eyJ1Ijoic2F1bGlrIiwiYSI6ImNrcWM4NXJoYzAwdzkybm56djVka2VzZW0ifQ.QmYDZh6DNEwu5ITY9lQ6Ag";

function Map(props) {
  const [viewport, setViewport] = useState({
    latitude: 62,
    longitude: 25,
    zoom: 5,
  });

  const [paikat, setPaikat] = useState([...props.data]);
  console.log("PAIKAT", paikat);

  useEffect(() => {
    setPaikat(props.data);
  }, [props.data]);

  if (paikat.length > 1) {
    paikat[0].map((paikka) =>
      console.log("koordinaatti:", paikka.koordinaatti[0])
    );
  }
  //console.log("map rendered");
  //console.log("paikat:", props.data);
  /* console.log("Mapissa maakunta: ", props.maakunta);
  console.log("Mapissa tyyppi: ", props.tyyppi);
  console.log("Mapissa paikat: ", props.data); */

  //paikat[0].map((paikka, index) => console.log("Paikka", paikka.maakunta));

  return (
    <ReactMapGl
      className="map"
      {...viewport}
      mapboxApiAccessToken={access_token}
      mapStyle="mapbox://styles/mapbox/streets-v11"
      height={800}
      width={600}
      onViewportChange={(viewport) => {
        setViewport(viewport);
      }}
    >
      {paikat.length > 0 &&
        paikat[0].map((paikka) => (
          <button
            latitude={parseFloat(paikka.koordinaatti[0])}
            longitude={parseFloat(paikka.koordinaatti[1])}
          >
            mitä
          </button>
        ))}
    </ReactMapGl>
  );
}

export default Map;
